import AddUser from './components/AddUser';
import UsersList from './components/UsersList';
import ErrorModal from './components/ErrorModal';

function App() {
  return (
    <div>
          <AddUser></AddUser>
          <UsersList></UsersList>
          <ErrorModal>test</ErrorModal>
    </div>
  );
}

export default App;
